#!ec-perl

use ElectricCommander;
use strict;

$| = 1;

my $ec = new ElectricCommander();

# Get outcome statistics
my @filterList;
push (@filterList, {"propertyName" => "jobName",
                        "operator" => "like",
                        "operand1" => "Heat Clinic Store%Deploy%"});
my $result = $ec->findObjects('job',
        {
		maxIds    => "100",
		filter => [
     { operator => 'or',
         filter => \@filterList,
    }
  ],
		sort => [{propertyName => "createTime",
				order => "descending"}], 
 }
);

my %success = ();
my %error = ();
foreach my $job ($result->find("//jobName")->get_nodelist) {
	my $jobName = $job->find("../jobName")->string_value();
	my $environment = $ec->getProperty("/jobs/$jobName/environment")->find("//value")->string_value();
	my $status = $job->find("../outcome")->string_value();
	$success{$environment}++ if ($status ne 'error');
	$error{$environment}++ if ($status eq 'error');
	#print "$jobName $environment $status\n";
}


$XHTML .= qq(
<h1>Deployments for <a href="/commander/link/workflowDefinitionDetails/projects/Heat/workflowDefinitions/Heat%20Clinic%20Development%20Pipeline">Development Pipeline</a></h1>

<table border="5" cellpadding="10">
	<tr>
		<th>Environment</th>
		<th>Application Version</th>
		<th>Successful</th>
		<th>Failures</th>
	</tr>
);

my $ec = new ElectricCommander();

my $environments=$ec->getEnvironments("Default")->find("//environment");
foreach my $environment ($environments->get_nodelist) {
	my $environmentName = $environment->find("//environmentName")->string_value;
	$XHTML .= qq(
	<tr>
		<td>$environmentName</td>
	);

	my $artifactVersion=$ec
		->getEnvironmentInventoryItems("Default", $environmentName)
		->find("//environmentInventoryItem[contains(./artifactName,'warfile')]//artifactVersion")->string_value;

	$XHTML .= qq(
		<td>$artifactVersion</td>
		<td>$success{$environmentName}</td>
		<td>$error{$environmentName}</td>
	</tr>
	)

}


$XHTML .= qq(
</table>
);

