                        "operator" => "like",
                        "operand1" => "heat_clinic_%"});
# push (@filterList, {"propertyName" => "scheduleName",
                        # "operator" => "equals",
                        # "operand1" => "1.0"});
my $result = $ec->findObjects('workflow',
        {
		maxIds    => "20",
		filter => [
     { operator => 'or',
         filter => \@filterList,
    }
  ],
		sort => [{propertyName => "createTime",
				order => "descending"}], 
 }
);

my $envIndex=0;
my $row="oddRow";
for my $workflowNames ($result->find("//workflowName")->get_nodelist) {
        #print $jobId->string_value() . "\n";

		$envIndex++;
		$row = "evenRow" if not $envIndex % 2;
		$row = "oddRow" if $envIndex % 2;

        my $workflowName = $workflowNames->string_value();
        my $releaseCandidateNumber = $ec->getProperty("/myWorkflow/releaseCandidateNumber", {projectName => "Heat Clinic", workflowName => $workflowName})->find("//value");

