		$XHTML .= qq(
	<tr class=\"$row\">
		<td>
			<table>
				<tr>
					<td><a href=$workflowLink title="Workflow Link">$releaseCandidateNumber</a></td>
				</tr>
			</table>
		</td>
		);

	my @transitions = ('Promote to TEST','Promote To STAGE','Promote To PROD','Hot Patch To PROD');
	foreach (@transitions) {
		my @filterList;
		push (@filterList, {"propertyName" => "containerName",
								"operator" => "equals",
								"operand1" => $workflowName});
		push (@filterList, {"propertyName" => "subjectName",
								"operator" => "equals",
								"operand1" => $_});
		my $result = $ec->findObjects('logEntry',
				{filter => [
