sub convert($) {
    my ($in) = @_;
    my ($yr, $mon, $day, $hr, $min, $sec, $ms) = $in =~ m/(\d+)-(\d+)-(\d+)T(\d+):(\d+):(\d+).*/;
    my $ampm = $hr < 12 ? "AM": "PM";
    my @abbr = qw(Jan Feb Mar Apr May Jun Jul Aug Sep Oct Nov Dec);
    $mon = $abbr[$mon-1];
    $day -= 0; # remove leading zeros
    $hr -= 0; # remove leading zeros
    if ($hr >= 12) {
        $hr -= 12;
    }
    if ($hr == 0) {
        $hr = 12;
    }
    return "$mon $day, $yr $hr:$min$ampm";
}

