use ElectricCommander;
use strict;

$| = 1;

#Create a reference to ElectricCommander
my $ec = new ElectricCommander();

my $workflowName = $ec->runWorkflow(
	"$[/myProject/projectName]", "Development Pipeline",
    {startingState => "Start", actualParameter => [
    	{actualParameterName => "application", value => "$[/myJob/application]"},
        {actualParameterName => "releaseCandidateNumber", value => "$[/myJob/artifactVersion]"},
        {actualParameterName => "launchJobId", value => "$[/myJob/jobId]"}
    ]
